import './App.css';
import Navbar from './components/Navbar'
import About from "./components/About";
import Background from "./components/Background";
import Experience from "./components/Experience";
import Projects from "./components/Projects";
function App() {
  return (
      <div className="App">
          <Background/>
          <Navbar/>
          <About/>
          <Experience/>
          <Projects />

      </div>
  );
}

export default App;
